import React from 'react'
import chars from "../data/chars.json"

function Main() {

  return (
    <div className="container">
      <div className="row">
      {chars.map(char=>{
        return(
          <div className="col s3">
            <img src={char.image} alt={char.name} className="responsive-img"/>
          </div>
        )
      })}
      </div> 
    </div>
  )
}

export default Main
